import React, { Component } from 'react';
import keys from './components/keyboard';
import './App.css';

function App() {
  createKeys = () => {
    const keys = [];
    for (let i = 1; i < 10; i++) {
        keys.push(
            <button key={i}>{i}</button>
        );
    }
    return keys;
}

  return (
    <Keys></Keys>
  );
}

export default App;
